// VerificationFailedPage.js
import React from 'react';
import '../../styles/pages/authentication/VerificationFailedStyle.css';

function VerificationFailedPage() {
    return (
        <div className="email-verification-container"
             style={{backgroundImage: `url(${process.env.PUBLIC_URL}/map.png)`}}>
            <div className="email-verification-message">
                <h2 className="error-title">Email Verification Failed</h2>
                <p className="error-text">Sorry, email verification failed. Please try again or contact support.</p>
                <a href="/login" className="home-button">Go to Login</a>
            </div>
        </div>
    );
}

export default VerificationFailedPage;
